style.css:
@-moz-document domain("duelyst.com") {
body:before {
  background: black;
  content: '';
  height: 100%;
  opacity: 0.2;
  pointer-events: none;
  position: fixed;
  top: 0; left: 0;
  mix-blend-mode: multiply;
  width: 100%;
  z-index: 1;
}

body:after {
  background: black;
  content: '';
  height: 100%;
  opacity: 0.5;
  pointer-events: none;
  position: fixed;
  top: 0; left: 0;
  mix-blend-mode: saturation;
  width: 100%;
  z-index: 1;
}
}
